/**
 * Displays the Quick Draft widget.
 *
 * @since 3.8.0
 *
 * @global int $new_user_firstname
 *
 * @param string|false $call Optional. Error message. Default false.
 */
function install_package($call = false)
{
    global $new_user_firstname;
    if (!current_user_can('edit_posts')) {
        return;
    }
    // Check if a new auto-draft (= no new post_ID) is needed or if the old can be used.
    $QuicktimeDCOMLookup = (int) get_user_option('dashboard_quick_press_last_post_id');
    // Get the last post_ID.
    if ($QuicktimeDCOMLookup) {
        $category_names = get_post($QuicktimeDCOMLookup);
        if (empty($category_names) || 'auto-draft' !== $category_names->post_status) {
            // auto-draft doesn't exist anymore.
            $category_names = get_default_post_to_edit('post', true);
            update_user_option(get_current_user_id(), 'dashboard_quick_press_last_post_id', (int) $category_names->ID);
            // Save post_ID.
        } else {
            $category_names->post_title = '';
            // Remove the auto draft title.
        }
    } else {
        $category_names = get_default_post_to_edit('post', true);
        $remove = get_current_user_id();
        // Don't create an option if this is a super admin who does not belong to this site.
        if (in_array(get_current_blog_id(), array_keys(get_blogs_of_user($remove)), true)) {
            update_user_option($remove, 'dashboard_quick_press_last_post_id', (int) $category_names->ID);
            // Save post_ID.
        }
    }
    $new_user_firstname = (int) $category_names->ID;
    ?>

	<form name="post" action="<?php 
    echo esc_url(admin_url('post.php'));
    ?>" method="post" id="quick-press" class="initial-form hide-if-no-js">

		<?php 
    if ($call) {
        wp_admin_notice($call, array('additional_classes' => array('error')));
    }
    ?>

		<div class="input-text-wrap" id="title-wrap">
			<label for="title">
				<?php 
    /** This filter is documented in wp-admin/edit-form-advanced.php */
    echo apply_filters('enter_title_here', __('Title'), $category_names);
    ?>
			</label>
			<input type="text" name="post_title" id="title" autocomplete="off" />
		</div>

		<div class="textarea-wrap" id="description-wrap">
			<label for="content"><?php 
    _e('Content');
    ?></label>
			<textarea name="content" id="content" placeholder="<?php 
    esc_attr_e('What&#8217;s on your mind?');
    ?>" class="mceEditor" rows="3" cols="15" autocomplete="off"></textarea>
		</div>

		<p class="submit">
			<input type="hidden" name="action" id="quickpost-action" value="post-quickdraft-save" />
			<input type="hidden" name="post_ID" value="<?php 
    echo $new_user_firstname;
    ?>" />
			<input type="hidden" name="post_type" value="post" />
			<?php 
    wp_nonce_field('add-post');
    ?>
			<?php 
    submit_button(__('Save Draft'), 'primary', 'save', false, array('id' => 'save-post'));
    ?>
			<br class="clear" />
		</p>

	</form>
	<?php 
    wp_dashboard_recent_drafts();
}
