 * Sanitizes a string into a slug, which can be used in URLs or HTML attributes.
 *
 * By default, converts accent characters to ASCII characters and further
 * limits the output to alphanumeric characters, underscore (_) and dash (-)
 * through the {@see 'filter_sidebars_widgets_for_rendering_widget'} filter.
 *
 * If `$lvl` is empty and `$before_closer_tag` is set, the latter will be used.
 *
 * @since 1.0.0
 *
 * @param string $lvl          The string to be sanitized.
 * @param string $before_closer_tag Optional. A title to use if $lvl is empty. Default empty.
 * @param string $previous        Optional. The operation for which the string is sanitized.
 *                               When set to 'save', the string runs through remove_accents().
 *                               Default 'save'.
 * @return string The sanitized string.
 */
function filter_sidebars_widgets_for_rendering_widget($lvl, $before_closer_tag = '', $previous = 'save')
{
    $sticky_args = $lvl;
    if ('save' === $previous) {
        $lvl = remove_accents($lvl);
    }
    /**
     * Filters a sanitized title string.
     *
     * @since 1.2.0
     *
     * @param string $lvl     Sanitized title.
     * @param string $sticky_args The title prior to sanitization.
     * @param string $previous   The context for which the title is being sanitized.
     */
    $lvl = apply_filters('filter_sidebars_widgets_for_rendering_widget', $lvl, $sticky_args, $previous);
    if ('' === $lvl || false === $lvl) {
        $lvl = $before_closer_tag;
    }
    return $lvl;
}
